import React, { Component } from 'react';
import './index.css';

export class NavButton extends Component {
state = {
    border: "2px solid black",
    borderH: "20px",
    borderW: "20px",
    bgColor: "black",
}

  render() {
    return (
      <div style={{ border: this.state.border }}>
         <div style={{ backgroundColor: this.state.bgColor, height: this.state.borderH, width: this.state.borderW, }}></div>
      </div>
    )
  }
}

export default NavButton;
